    mixins: [],
    head() {
      const head =
        typeof customHead === 'function'
          ? customHead.call(this, this)
          : customHead || {}

      const htmlAttrs = {
        lang: this.$siteConfig.lang,
        ...head.htmlAttrs
      }

      if (!htmlAttrs.lang) {
        delete htmlAttrs.lang
      }

      return {
        ...head,
        htmlAttrs,
        meta: [
          {
            name: 'generator',
            content: `Saber v${__SABER_VERSION__}`
          },
          ...(head.meta || [])
        ]
      }
    },
    provide: {
      layouts
    },
    layouts,
    router,
    data() {
      return {
        transition: null
      }
    },
    mounted() {
      scrollHandler(
        this.$router,
        this.$router.currentRoute,
        this.$router.currentRoute
      )
    },
    render(h) {
      const transition = Object.assign({}, this.transition)
      const listeners = {}
      Object.keys(transition).forEach(key => {
        if (typeof transition[key] === 'function') {
          const kebabKey = key.replace(
            /([a-z])([A-Z])/,
            (_, p1, p2) => `${p1}-${p2.toLowerCase()}`
          )
          listeners[kebabKey] = transition[key]
          delete transition[key]
        }
      })
      const beforeEnter = listeners['before-enter']
      listeners['before-enter'] = el => {
        this.$nextTick(() => {
          this.$emit('trigger-scroll')
        })
        beforeEnter && beforeEnter(el)
      }

      const children = [
        h(
          'transition',
          {
            props: transition,
            on: listeners
          },
          [h('router-view')]
        )
      ]
      return h('div', { attrs: { id: '_saber' } }, [
        customRootComponent ? h(customRootComponent, {}, children) : children
      ])
    },
    methods: {
      setTransition(name) {
        this.transition = name
      },

      getPageLink(link) {
        if (typeof link !== 'string' && process.env.NODE_ENV !== 'production') {
          throw new TypeError(`Expect link to be a string`)
        }

        const matched = /^([^#?]+)([#?].*)?$/.exec(link)

        if (!matched) {
          return link
        }

        const relativePath = join(
          dirname(this.$route.meta.__relative),
          matched[1]
        )
        const extra = matched[2] || ''
        for (const route of this.$router.options.routes) {
          if (route.path === matched[1]) {
            return link
          }

          if (
            route.meta &&
            route.meta.__relative &&
            relativePath === route.meta.__relative
          ) {
            return `${route.path}${extra}`
          }
        }

        // Not a page
        return undefined
      }
    }
  }

  const setHead = input => (customHead = input)
  const setRootComponent = input => (customRootComponent = input)

  const browserApiContext = {
    Vue,
    router,
    rootOptions,
    setHead,
    setRootComponent
  }

  injectConfig(browserApiContext)
  extendBrowserApi(browserApiContext)
  // Set transition after calling `extendBrowserApi`
  // Because user might use `beforeEach` hook to add progress bar
  setTransition(browserApiContext)

  const app = new Vue(rootOptions)

  return {
    app,
    router
  }
}

// Reloading browser when following files change
if (module.hot) {
  module.hot.accept(['#cache/layouts', '#cache/runtime-polyfills'], () => {
    location.reload()
  })
}

export default ({ router }) => {
  if (process.browser) {
    function normalizeTransition(transition, to, from) {
      if (typeof transition === 'function') {
        transition = transition(to, from)
      } else if (typeof transition === 'string') {
        transition = { name: transition }
      }

      return transition
    }

    async function getTransition(route, args) {
      if (
        !route ||
        !route.matched.length ||
        !route.matched[0].components.default
      ) {
        return
      }

      // The default router component
      let RouteComponent = route.matched[0].components.default
      // Resolve async component
      if (typeof RouteComponent === 'function') {
        RouteComponent = await RouteComponent()
      }

      // ES compat
      RouteComponent = RouteComponent.default || RouteComponent

      const routeTransition = normalizeTransition(
        RouteComponent.transition,
        ...args
      )

      let layoutTransition
      if (RouteComponent.layout) {
        const { layouts } = router.app.$options
        const LayoutComponent =
          layouts[RouteComponent.layout] || layouts.default
        if (LayoutComponent) {
          layoutTransition = normalizeTransition(
            LayoutComponent.transition,
            ...args
          )
        }
      }

      return Object.assign(
        {
          name: 'page',
          mode: 'out-in'
        },
        routeTransition || layoutTransition
      )
    }

    router.beforeEach(async (to, from, next) => {
      const [toTransition, fromTransition] = await Promise.all([
        getTransition(to, [to, from]),
        getTransition(from, [to, from])
      ])

      if (fromTransition) {
        for (const key of Object.keys(fromTransition)) {
          // prefer `leave` transitions of 'from' route
          if (/leave/i.test(key)) {
            toTransition[key] = fromTransition[key]
          }
        }
      }

      router.app.setTransition(toTransition)

      next()
    })
  }
}

import createApp from './create-app'

export default async context => {
  const { app, router } = createApp(context)
  router.push(context.url)

  await new Promise((resolve, reject) => {
    router.onReady(resolve, reject)
  })

  if (context.res && router.currentRoute.name === 404) {
    context.res.statusCode = 404
  }

  context.metaInfo = app.$meta()
  context.app = app

  return app
}
